var title_f18_63_19445="Neutrophil migration";
var content_f18_63_19445=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=HEME%2F78149&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=HEME%2F78149&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 483px\">",
"   <div class=\"ttl\">",
"    Determinants of neutrophil migration",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 463px; height: 317px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This figure illustrates circulating neutrophil interactions with vascular endothelial cells during recruitment to sites of infection or inflammation. At left, neutrophils (PMNs) and endothelial cells are represented in their basal states prior to exposure of either cell type to inflammatory mediators. Constitutive ICAM-2 is expressed on endothelial cells and does not affect free-flowing PMN, which constitutively express L-selectin and its ligand SleX. The adjacent right section illustrates PMN rolling onto endothelial cells, which express E-selectin after activation by IL-1, TNF-alpha, or endotoxin. E-selectin induces attachment of PMN to endothelial cells, mediated by the L- selectin ligand SleX. Endothelial cells release IL-8, GM-CSF and PAF, while other chemoattractants may also be sensed by rolling PMN. One or more of these molecules induce PMN to express beta-2 integrin Mac 1 (and LFA-1, not shown) which mediates firm adherence of PMN to ICAM-1 expressed by activated endothelial cells. At right, PMN is illustrated crawling along endothelial cells and squeezing between them, aided by endothelial cell PECAN-1, which binds PMN Mac-1. The sub-endothelial basement membrane is eroded, presumably by secretion of PMN gelatinase B and elastase.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Robert Baehner, MD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
