var title_f18_63_19448="TAPVC anatomic variants";
var content_f18_63_19448=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PEDS%2F77375&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PEDS%2F77375&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 481px\">",
"   <div class=\"ttl\">",
"    Diagram of common types of totally anomalous pulmonary venus connection (TAPVC)",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 461px; height: 612px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    A) Supracardiac TAPVC to the left innominate vein. The individual pulmonary veins form a horizontal pulmonary venous confluence (HVC) that connects to the left innominate vein by way of a vertical vein. B) Infradiaphragmatic TAPVC to the portal vein. The pulmonary veins form a vertical confluence that descends below the diaphragm and typically joins the portal vein (PV). Pulmonary venous blood then drains into the inferior vena cava (IVC) via the ductus venosus or the hepatic sinusoids. The individual pulmonary veins may join the vertical vein at different levels. C) TAPVC to the coronary sinus (CS). D) Mixed-type TAPVC. In the example shown, the left pulmonary veins (LPV) connect to the left innominate vein (LIV), and the right pulmonary veins (RPV) connect with the CS. E) Total anomalous pulmonary venous drainage owing to malposition of septum primum. The pulmonary veins connect normally to the back wall of the atria, but pulmonary venous drainage is to the right of the malattached septum primum (arrow) (in atrial situs solitus).",
"    <div class=\"footnotes\">",
"     HV: hepatic vein; LA: left atrium; RA: right atrium; SMV: superior mesenteric vein; SV: splenic vein.",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Allen HD, Driscoll DJ, Shaddy RE, Feltes TF. Moss and Adams' Heart Disease in Infants, Children, and Adolescents: Including the Fetus and Young Adult, 7th ed, Lippincott Williams &amp; Wilkins, Philadelphia, 2008. Copyright &copy; 2008 Lippincott Williams &amp; Wilkins.",
"    </div>",
"    <div class=\"contractual\">",
"     <br/>",
"     <a href=\"file://www.lww.com\">",
"      file://www.lww.com",
"     </a>",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
