var title_f18_63_19451="Principles of consultation etiquette";
var content_f18_63_19451=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PALC%2F87191&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PALC%2F87191&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Principles of medical consultation etiquette",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        <ol>",
"         <li>",
"          Determine the question (How can I help you in your care of patient X?).",
"         </li>",
"         <li>",
"          Triage urgency of the consultation&nbsp;(emergent versus urgent versus elective).",
"         </li>",
"         <li>",
"          Gather your own data (thorough history and focused physical examination).",
"         </li>",
"         <li>",
"          Brevity (focus your consult notes on assessment/recommendations).",
"         </li>",
"         <li>",
"          Specificity (goal-oriented recommendations).",
"         </li>",
"         <li>",
"          Plan ahead (contingency plans for anticipated future problems).",
"         </li>",
"         <li>",
"          Honor \"turf\" (be careful to address the problem for which you were called).",
"         </li>",
"         <li>",
"          Teach&mdash;with tact (viewing every consultation as a teaching, and marketing, opportunity).",
"         </li>",
"         <li>",
"          Personal contact (respond directly to the requesting physician).",
"         </li>",
"         <li>",
"          Follow-up (including your ongoing role and knowing when to sign off).",
"         </li>",
"        </ol>",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced with permission from: Meier DE, Beresford L. Consultation etiquette challenges palliative care to be on its best behavior. J Palliat Med 2007; 10:7. Copyright &copy; 2007 Mary Ann Liebert, Inc. Publishers.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
